  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115603 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the North Atlantic
  Ocean from 1999-08-13 to 1999-08-31 and retrieved during cruise 06MT19990813 (06MT45_4).
  These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
  HYDROSTATIC PRESSURE, Potential temperature (theta), SALINITY and WATER TEMPERATURE.
  The instruments used to collect these data include CTD and bottle. These data were
  collected by J. Meincke of Institute Fuer Meereskunde as part of the CARINA/06MT19990813,
  WOCE AR25h, VEINS) data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean)
  data synthesis project is an international collaborative effort of the EU IP CARBOOCEAN,
  and U.S. partners. It has produced a merged internally consistent data set of open
  ocean subsurface measurements for biogeochemical investigations, in particular,
  studies involving the carbon system. The original focus area was the North Atlantic
  Ocean, but over time the geographic extent expanded and CARINA now includes data
  from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
